燃烧指节可派生搓招 = _root.技能函数.燃烧指节可派生搓招;

onClipEvent (enterFrame) {
   //_parent.攻击时斜向移动(-20,-25);
   _parent.攻击时移动(-25,-30);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{	
		_parent.后撤步可派生搓招();

		if(Key.isDown(_parent._parent.A键))
		{_parent.gotoAndPlay("截拳5连招");}
	}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
